import React from 'react';
import './styles.css';
import { Link } from 'react-router-dom';
import data from './data';
import ShoppingList from './ShoppingList'
import AllShoppingLists from './AllShoppingLists';

export class ShoppingListViewer extends React.Component {
    render() {
        return(
            <section className='wrapper'>
       
                    <ListOfLists />
                    <ListOfProducts />
                    <section class="listoflists"><h2>All Shopping Lists</h2></section>

                
            </section>
        );
    }

}


class ListOfLists extends React.Component {
    render() {
        return <section class="listoflists"><h2>All Shopping Lists</h2></section>
    }
}

class ListOfProducts extends React.Component {
    render() {
        return <h2>List of Products</h2>
    }

}



export default ShoppingListViewer;
